/*
Given a string s, find the length of the longest substring without duplicate
characters.
*/

#include <stdio.h>
int lengthOfLongestSubstring(char *s) {
  if (s[0] == '\0') {
    return 0;
  }
  int max = 0;
  int t = 0;

  int l = 0, r = 1;
  int repeat = 0;

  while (s[r] != '\0') {
    for (int i = l; i < r; i++) {
      if (s[r] != s[i]) {
        t = r - l + 1;
      } else {
        repeat = 1;
        break;
      }
    }
    if (repeat == 0) {
      r++;
    } else if (repeat == 1) {
      l++;
      repeat = 0;
      t = 0;
    }

    if (t > max) {
      max = t;
    }
  }
  if (max == 0) {
    max = 1;
  }
  return max;
}

